import React from 'react'
import Work1 from '../../assets/back.jpg';

const WorksItems = ({item}) => {
  return (
    <div className="work__card" key={item.id}>
        <img src={item.image} alt="" className='wor__img' />
    </div>
  )
}

export default WorksItems
